import { PlusIcon } from "@heroicons/react/outline";

function Feed() {
    return (

        <div className="flex justify-center">
            <div className="flex m-4 py-2 px-4 items-center cursor-pointer hover:bg-gray-700 font-bold rounded-full bg-cyan-400">
                <PlusIcon className="p-0.5 h-7 text-white"/>
                <p className="text-white text-bold">Add Blog</p>
            </div>
        </div>

    )
}

export default Feed;
